import { Link } from "react-router-dom";
function Header() {
  return (
    <div
      className="menu"
      style={{
        backgroundColor: "#b9114b",
        padding: 0,
        margin: 0,
        height: "100%",
        width: "100%",
      }}
    >
      <a href="/">
        <img src="https://youxgroup.com.br/wp-content/uploads/2021/07/logosite.png" />
      </a>
      <div>
        <Link to="/">Hom</Link>
      </div>
    </div>
  );
}

export default Header;
